import numpy as np
from scipy.io.wavfile import write

def make_audio(values, index):
    samplerate = 44100
    tone_duration = 1.0  # seconds per tone
    min_freq = 220   # Hz (A3)
    max_freq = 1760  # Hz (A6)

    values = np.array(values)
    norm = (values - np.min(values)) / (np.max(values) - np.min(values))

    amps = np.zeros_like(norm)
    for i, v in enumerate(values):
        if v < 0.004:
            amps[i] = 0.05  # Very quiet
        else:
            amps[i] = np.log1p(norm[i] * 9) / np.log1p(9)  # Logarithmic mapping

    # Logarithmic mapping for frequency
    log_min = np.log(min_freq)
    log_max = np.log(max_freq)
    freqs = np.exp(log_min + norm * (log_max - log_min))

    audio = []
    for freq, amp in zip(freqs, amps):
        t = np.linspace(0, tone_duration, int(samplerate * tone_duration), endpoint=False)
        tone = amp * np.sin(2 * np.pi * freq * t)
        audio.append(tone)

    audio = np.concatenate(audio)
    audio_int16 = np.int16(audio / np.max(np.abs(audio)) * 32767)
    write(f"tones_{index}.wav", samplerate, audio_int16)
    print(f"Saved tones_{index}.wav")

